import React from 'react';
import './App.css';
import './boutonco.css';

/*import FunctionClick from './FunctionClick' ;*/

class App extends React.Component {
  btnClick(){
    alert("Button clicked");
  }
  render() {
  return (
    <div className="App">
       <div class="nav">
    <ul>
        <li><button class="boutonco" style="vertical-align:middle" onClick={btnClick}><span>Se connecter</span>
        </button></li>
    </ul>
</div>
    </div>
  );
}}


export default App;
